-- A project is a way to group tests that have the same processing rules.
--	Generally the grouping rules are by testname and status.  So tests A, B, and C with "completed" status are processed according to the rules of project D.
--	Note here that resets, invalidations, and expired tests all have different rules and therefore different projects.
--	If they didn't have different rules, the could be grouped into the same project.
--	Generally separate projects are createed for diffrent subjects, but that's not required if they have the same rules.
