-- map component tests and segments to the corresponding combo tests and segments
--	This will be be a N component test -> 1 combo test mapping.  The combo test will have enough segments to accommodate all segments in all of its component tests
--	For summative SBAC tests, a 1/N component test and segment to 1 combo test and segment is required.  1/N performance task tests will correspond to a single combo test's segment(s).
--	The student will typically take 1 performance task test, but if more than one is taken, the test combo code has rules for which one to select to include in the combo.
